import React from 'react';
import logo from './logo.svg';
import './App.css';

/*

1: (If you dont have React Installed) In index.js
*Create the boilerplate to get React to render something on the screen
*Render an <App /> component, which you'll need to create separatly




 */

function App() {
  return (
    <div className="App">

    <h1>Hello world</h1>

    </div>
  );
}

export default App;
